('pl', '_template', 'atutor_accessibility_text', '<p> ATutor zawiera rózne cechy tak aby zapewnić treść dla wszystkich użytkowników, włączając\r\ntych z wolnym łączem internetowym czy starymi przeglądarkami internetowymi.\r\n Cechy te zostaly opisane nizej. W zaleznosci jaki motyw jest uzywany ATutor moze zawierac je wszystkie lub tylko czesc.\r\nDomyslny motyw umozliwia korzystanie z ich wszystkich </p>\r\n\r\n<ol>\r\n<li><strong>Linki Bezpośrednie</strong> W lewym górnym rogu ATutor\r\nposiada specjalne linki pozwalające na nawigacje po otwartej tresci\r\nNacisnij Tab raz po zaladowaniu sie strony aby zaznaczyc pierwszy z elementow\r\ntego menu i wcisnij Enter aby wyswietlic zawartosc. Istnieje rowniez mozliwosc\r\nuzycia Alt-C jest wiec mozliwosc przeskoczenia do gory ekranu nie zaleznie od tego gdzie znajduje sie kursor\r\n<br /><br />\r\n\r\nMozliwe jest rowniez przeskawianie po zawartosciach tabel np przy wyborze emotikonow\r\n\r\n<br /><br /></li>\r\n\r\n<li><strong> KlawiszDostepu</strong> Aby aktywowac klawisze dostepu\r\nnacisnij Alt plus przypisana liczba lub znak. KlawiszeDostepu sa przydzielane\r\ndynamicznie do zakladek w Mojej Nawigacji. Pierwsza zakladka to Alt-1 druga Alt-2 i tak dalej\r\nWazne: Nie wszystkie przegladarki moga to obslugiwac <br /><br />\r\n\r\nOgolne KlawiszeDostepu\r\n<ul>\r\n<li>[Alt-1 to Alt-0] Zakladki Moja Nawigacja</li>\r\n<li>[Alt-,] Poprzedni temat </li>\r\n<li>[Alt-.] Nastepny temat </li>\r\n<li>[Alt-.] Przywroc </li>\r\n<li>[Alt-j] Jump Menu</li>\r\n<li>[Alt-s] Klawisz Akcji (Wyslij, Zapisz)</li>\r\n<li>[Alt-c] Przeskocz do gory biezacej zawartosci</li>\r\n</ul>\r\n\r\nKlawiszeDostepu Edytora Zawartosci\r\n<ul>\r\n<li>[Alt-n] Zakladki zawartosci</li>\r\n<li>[Alt-p] Zakladka Wlasciwosci</li>\r\n<li>[Alt-g] Zakladka Slownika</li>\r\n<li>[Alt-r] Zakladka Podgladu</li>\r\n<li>[Alt-a] Zakladka Dostepnosci</li>\r\n<li>[Alt-s] Zapisz</li>\r\n</ul>\r\n\r\nKlawiszeDostepu Chat \r\n<ul>\r\n<li>[Alt-c] Jump to Compose Message field</li>\r\n<li>[Alt-r] Odswiez wiadomosc </li>\r\n<li>[Alt-m] Skocz do listy wiadomosci</li>\r\n<li>[Alt-q] Opusc chat</li>\r\n</ul>\r\n\r\nKlawiszeDostepu Skrzynki odbiorczej\r\n<ul>\r\n<li>[Alt-r] Odpowiedz</li>\r\n</ul>\r\n<br />\r\n\r\nKlawiszeDostepu Edytora Wizualnego\r\n<ul>\r\n<li>[Alt-q] skocz do przycisku</li>\r\n<li>[Alt-z] skocz do pola edycji zawartosci</li>\r\n<li>[Alt-x] skocz do sciezki elementu</li>\r\n</ul>\r\n</li>\r\n\r\n<li> <strong> Weryfikacja Dostepnosci: </ strong> Podczas korzystania z ATutor Edytora Zawartosci, instruktor może sprawdzić \r\ndostępność ich zawartość, aby upewnić się może dostępna dla wszystkich studentów, \r\nw tym za pomocą technologii wspomagających lub technologii, starszych. \r\nPodczas korzystania z Edytora Zawartosci, wybierz opcję [Alt-a], \r\naby otworzyć weryfikator dostępności. </ li>\r\n\r\n<li> <strong> Tekst alternatywny: </ strong> Wszystkie znaczące \r\nobrazy w ATutor zawierają tekst alternatywny, który opisuje obraz \r\nlub jego funkcji. W przypadku gdy zdjęcia nie są znaczące \r\natrybutu alt jest puste więc technologii wspomagających zignoruje obrazu. </ li>\r\n\r\n<li> <strong> Alternatywna Nawigacja: </ strong> Global, hierarchiczny, i \r\nkolejne narzędzia nawigacyjne są dostępne, \r\nwięc użytkownicy mogą przeglądać i strukturę treści w sposób, \r\nktóry najbardziej odpowiada ich styl uczenia się. ATutor MapaStrony zawiera pełną \r\nlistę wszystkich treści i narzędzi, więc wszystkie funkcje \r\nw kursie można uzyskać dostęp z jednego miejsca. </ li>\r\n\r\n<li> <strong> Wznów / Kontynuuj: </ strong> ATutor zapamiętuje ostatnio strona uzyskać, gdy użytkownik opuszcza treści kształcenia, aby przejść do forum, na przykład, dzięki czemu można szybko znaleźć drogę tam, gdzie została przerwana. \r\nLokalizacja zawartosci jest również pamiętać, pomiędzy sesjami, więc po powrocie do ATutor, \r\nużytkownicy mogą po prostu wybrać Wznów \r\nlink na aukcji oczywiście na Moje kursy lub wybierz ponownie \r\nlink w panierce na górze ekranu, raz na jakiś kurs. \r\nKorzystanie [Alt-.] KlawiszeDostepu również zwrócić użytkownika \r\ndo ostatniej strony treści, które były sprawdzające po przybyciu do kursu. </ li>\r\n\r\n<li> <strong> Ukryj menu: </ strong> Dla użytkowników starszych technologii wspomagających, które nie obsługują kolumny tekstu się w tabelkach, jest możliwe, aby ukryć zawartość menu ATutor nawigacji więc, że zawartość będzie wyświetlana w sposób liniowy prezentacji. Ukrywanie zawartości menu także oszczędza przestrzeń dla użytkowników oglądających ATutor na mniejszych ekranach. </ li>\r\n\r\n<li> <strong> Wyszukiwania i Sortowania: </ strong> Większość tabel danych towarzyszy narzędzie do wyszukiwania, lub filtr, więc szczególnych zapisów mogą być wyświetlane w tabeli, zmniejszenie ilości danych wyświetlanych w danym momencie. Większość tabel danych można sortować, wybierając etykietę nagłówka kolumny ponownie, pozwalając użytkownikom na zmniejszenie wyświetlania danych. </ li>\r\n\r\n<li> <strong> Nagłówek Tabeli Skojarzeń: </ strong> Wszystkie tabele danych są oznaczone poprzez element TH i zakres atrybutu w celu zapewnienia, że użytkownicy czytników ekranu są w stanie poruszać się wyświetla dane i zrozumieć, co każda komórka danych stanowi <. / li>\r\n\r\n<li> <strong> Etykiety Rodzaj: </ strong> Wszystkie pola formularza oznaczone są przez ATutor się za pomocą elementu label, aby zapewnić, że są one prawidłowo opisane dla użytkowników technologii wspomagających. Wyraźnego oznakowania, w ten sposób umożliwia również kliknąć na pole formularza etykietę, aby uaktywnić pola. Zapewnia to większy obszar docelowy dla tych ludzi, którzy mają trudności pozycjonowania wskaźnika myszy na małym obszarze, postaci, takiej jak przycisk lub pole wyboru. </ li>\r\n\r\n<li> <strong> Zeszyty Stylow (css): </ strong> W miarę możliwości prezentacji treści w ATutor jest kontrolowana przez elementów arkusza stylów. Pozwala to użytkownikom zmienić domyślny wygląd ATutor i stosują własne preferowanych stylów prezentacji (np. wzrost rozmiarów czcionek, stylów czcionek, kolorów, itp.) </ li>\r\n\r\nli> <strong> Podswietlenie Pola Formularza: </ strong> Na stronach, na których główna treść jest formą, kursor zostanie automatycznie umieszczona w pierwszym polu, tak aby po załadowaniu strony formularza, użytkownicy mogą rozpocząć wpisywanie w formularzu. Użytkownicy mogą zdecydować się na wyłączenie w formie focus ustawienia preferencji, jeśli utrudnia ona ich stosowania ekranów formularza. </ li>\r\n\r\n<li> <strong> Zmainy Rozmiaru Obrazu</ strong> W przeglądarkach obsługujących skalowanie zdjęć, ikon ATutor można powiększyć dla użytkowników mających problemy ze wzrokiem, co czyni je bardziej widoczne. (Np. Netscape 7 klawiszy Alt +). W miarę możliwości w stosunku środki były wykorzystywane także do innych funkcji w ATutor więc, gdy interfejs jest powiększyć lub zmniejszyć, wszystkie funkcje zmiany rozmiaru w stosunku do siebie, z zachowaniem ekranu symetrii. </ li>\r\n\r\n</ ol>', '2010-10-12 19:21:51', ''),
