('pl', '_template', 'atutor_is', '<strong><em>ATutor</em></strong> jest bazującym na otwartym kodzie <strong>Systemem Zarządzania Treścią Nauczania (Learning Content Management System - LCMS)</strong> zaprojektowane z myślą o dostępności i łatwości dostosowywania się w umyśle. Administratorzy mogą zainstalować lub zaktualizować ATutor w kilka minut. Nauczyciele mogą szybko tworzyć, paczki i rozpowszechniania instruktażowe treści, i prowadzić kursy online. Studenci uczą się w adaptacyjnym środowiska nauczania.', '2010-10-12 19:23:32', ''),
('pl', '_template', 'atutor_links', '<p> Dowiedz się więcej o <a href=\"http://atutor.ca/index.php\"> ATutor </ a>, przechodząc na poniższe linki: </ p>\r\n\r\n<ul>\r\n<li> <a href=\"http://atutor.ca/forums/index.php\"> Forum Dyskusyjne </ a> - post na forum użytkownika </ li>\r\n<li> <a href=\"http://atutor.ca/services/index.php\"> Serwis Pomocz </ a> - Jeśli potrzebujesz naszej pomocy, wsparcie jest dostępne </ li>\r\n<li>\r\n><a href=\"http://atutor.ca/atutor/translate/index.php\">Tłumaczenie </a>Sciagnij paczki jezykowe, zostan tlumaczem </li>\r\n<li><a href=\"http://atutor.ca/services/licensing.php\"> Licencja</a>\r\noprogramowanie ATutor jest dostępny za darmo pod pewnymi warunkami </ li>\r\n<li><a href=\"http://atutor.ca/atutor/download.php\"> Sciagnij ATutor</a>\r\n- Wszystkie oprogramowanie systemowe wymagane do uruchomienia ATutor można pobrać tutaj </ li>\r\n</ ui>', '2010-10-12 19:29:00', ''),
